import React from "react";
import CssBaseline from "@material-ui/core/CssBaseline";
import Typography from "@material-ui/core/Typography";
import Container from "@material-ui/core/Container";
import Navbar from "./Navbar";
import NewsFeedItem from "./NewsFeedItem";

const newFeedItemList = [
  { name: "", avatarUrl: "", contentImage: "", isFavorite: false, id: "1" },
  { name: "", avatarUrl: "", contentImage: "", isFavorite: false, id: "2" },
  { name: "", avatarUrl: "", contentImage: "", isFavorite: false, id: "3" },
  { name: "", avatarUrl: "", contentImage: "", isFavorite: false, id: "4" },
  { name: "", avatarUrl: "", contentImage: "", isFavorite: false, id: "5" },
];

const FixedContainer = () => {
  return (
    <React.Fragment>
      <CssBaseline />
      <Navbar />
      <Container fixed>
        <Typography
          component="div"
          style={{ backgroundColor: "#f2f2f2", height: "100vh" }}
        >
          {newFeedItemList.forEach((item) => {
            <NewsFeedItem />;
          })}
        </Typography>
      </Container>
    </React.Fragment>
  );
};

export default FixedContainer;
